                <Paper style={{padding: 2,textAlign: 'center'}}>xs=12 sm=6</Paper>
                </Grid>
                <Grid item xs={6} sm={3}>
                <Paper style={{padding: 2,textAlign: 'center'}}>xs=6 sm=3</Paper>
                </Grid>
                <Grid item xs={6} sm={3}>
                <Paper style={{padding: 2,textAlign: 'center'}}>xs=6 sm=3</Paper>
                </Grid>
                <Grid item xs={6} sm={3}>
                <Paper style={{padding: 2,textAlign: 'center'}}>xs=6 sm=3</Paper>
                </Grid>
                <Grid item xs={6} sm={3}>
                <Paper style={{padding: 2,textAlign: 'center'}}>xs=6 sm=3</Paper>
                </Grid>
            </Grid>
            </div>
        )
    }
}

export default GoalUpdate
